import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import AdminAds from "./pages/adminAds/AdminAds";
import Home from "./pages/home/Home";
import Blog from "./pages/adminAds/js/Blog";
import NavBar from "./pages/NavBar";
import Login from "./pages/login/Login";
import blogs from "./pages/adminAds/json/blogs.json";
import { InputInfProvider } from "./pages/contexts/EP";

const root = ReactDOM.createRoot(document.getElementById("root"));
function Logon() {
  return (
    <>
      <NavBar />
      <Login />
    </>
  );
}
function Element(props) {
  return (
    <>
      <header>
        <NavBar />
      </header>
      <Blog post={props.post} />;
    </>
  );
}
root.render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="posts" element={<AdminAds />} />
      <Route path="login" element={<InputInfProvider><Logon/></InputInfProvider>} />
      {blogs.map((ele, key) => (
        <Route
          key={key}
          path={"posts/" + (key + 1)}
          element={<Element post={ele} />}
        />
      ))}
    </Routes>
  </BrowserRouter>
);
